import React, { Component } from "react";
import axios from "axios";
import "./App.css";
import Search from "./components/Search";

export default class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      user: ""
    };
  }

  handleChange = e => {
    this.setState({
      user: e.target.value
    });
  };

  render() {
    return (
      <div>
        <Search name={this.state.user} changed={this.handleChange} />
      </div>
    );
  }
}
